import React from 'react'
import { Routes, Route, useNavigate } from 'react-router-dom';

import Home from './container/Home';
import Login from './container/Login'
const App = () => {
    return (
        <Routes>
            <Route path="login" element={<Login />} />
            <Route path="/*" element={<Home />} />
        </Routes>
    )
}

export default App
